import React from 'react';
import CovidService from './service';

class Index extends React.Component {
    constructor() {
        super();
        this.state = {
            dataCovid: []
        }
    }
    loadData = async () => {
        const dataAPI = await CovidService.summary();

        this.setState({dataCovid: dataAPI})
    }

    componentDidMount() {
        this.loadData();
    }
    render() {

        return (<div>
            <h1>Data Covid</h1>
        </div>)
    }
}
export default Index
